import React from 'react';

const NowPlayingCard = () => {
  return (
    <div className="now-playing-card">
      <img src="https://example.com/beat-it.jpg" alt="Beat It" />
      <div className="song-info">
        <h4>Beat It</h4>
        <p>Michael Jackson</p>
        <div className="controls">
          <button>Prev</button>
          <button>Play</button>
          <button>Next</button>
        </div>
      </div>
    </div>
  );
};

export default NowPlayingCard;
